import React from 'react';
import classes from './Home.module.css'
import s from './Block2.module.css';
import BlockHead from "../BlockHead/BlockHead";
import {NavLink} from "react-router-dom";


let Block2 = (props) => {
    return(
        <div className={s.item}>
            <b>{props.h2}</b> <br/>
            <p>{props.h1}</p> <br/>
            <span className={s.span}><strong><NavLink className={s.link} to='/'>{props.link}</NavLink></strong>{props.span}</span>
        </div>
    );
};


const  Home = (props) =>{
    let element = props.arrHead.map(e => <BlockHead text={e.text} img={e.img}/>);
    let element2 = props.homeBlock2.map(d=> <Block2 h1={d.h1} h2={d.h2} link={d.link} span={d.text}/>);
    return (

        <div className={classes.contentBlock}>
            {element}
            <div className={classes.blockItem}>
                {element2}
            </div>
        </div>

    );
};


export default Home;
